MatrixXd rus6::calc_loopclosure_Jacobiandot(const Math::VectorNd y, const Math::VectorNd ydot)
{
  	// This function calculates the loop closure Jacobian G
  	// for the mechanism
  	MatrixXd Gdot(21,6), TJ(2,2);
    VectorXd Q = VectorNd::Zero(dof_spanningtree);
    Q = rus6::calc_loopclosure_function(y);
    double VL = r_p;
    double ex = y(0);
    double ey = y(1);
    double ez = y(2);
    double roll = y(3);
    double pitch = y(4);
    double yaw = y(5);

    double exdot = ydot(0);
    double eydot = ydot(1);
    double ezdot = ydot(2);
    double rolldot = ydot(3);
    double pitchdot = ydot(4);
    double yawdot = ydot(5);

    double theta11 = -Q(0);
    double theta21 = -Q(6);
    double theta31 = -Q(9);
    double theta41 = -Q(12);
    double theta51 = -Q(15);
    double theta61 = -Q(18);

    double theta12 = Q(1);
    double theta22 = Q(7);
    double theta32 = Q(10);
    double theta42 = Q(13);
    double theta52 = Q(16);
    double theta62 = Q(19);

    double theta13 = Q(2);
    double theta23 = Q(8);
    double theta33 = Q(11);
    double theta43 = Q(14);
    double theta53 = Q(17);
    double theta63 = Q(20);

    double theta14 = Q(3);
    double theta15 = Q(4);
    double theta16 = Q(5);
    for(int i=0;i<21;i++)
    {
      for(int j=0;j<6;j++)
        Gdot(i,j) = 0;
    }
    return Gdot;
}
VectorXd rus6::calc_sysstate_q(const Math::VectorNd y)
{
   // This function calculates the angles of the mechanism depending on
	// the input angle

	VectorXd q = VectorNd::Zero(dof_spanningtree);
  VectorXd qfinal = VectorNd::Zero(dof_spanningtree);
	q = rus6::calc_loopclosure_function(y);

	return q;
}

MatrixXd rus6::calc_sysstate_qdot(const Math::VectorNd y, const Math::VectorNd ydot)
{
	// This function calculates the angular velocities of the mechanism
	// depending on the input angle and velocity

	VectorXd qdot(dof_spanningtree);
  VectorXd qdotfinal(dof_spanningtree);
	MatrixXd G(21,6);
	G = rus6::calc_loopclosure_Jacobian(y);

  qdot = G*ydot;

  return qdot;
}

MatrixXd rus6::calc_sysstate_qddot(const Math::VectorNd y, const Math::VectorNd ydot, const Math::VectorNd yddot)
{
	// This function calculates the angular acceleration of the mechanism
	// depending on the task space variable
	VectorXd qddot(dof_spanningtree);
  VectorXd qddotfinal(dof_spanningtree);
	MatrixXd Gdot(21,6);
  MatrixXd G(21,6);
  G = rus6::calc_loopclosure_Jacobian(y);
  Gdot = rus6::calc_loopclosure_Jacobiandot(y, yddot);
	qddot = G*yddot + Gdot*ydot;
  return qddot;
}

MatrixXd rus6::rotation_x(double angle)
{
	// This function calculates the rotation matrix about z
	// the input angle
  MatrixXd Rx_clock(3,3);
  Rx_clock <<  1,0,0,
               0,cos(angle), sin(angle),
               0,-sin(angle), cos(angle);

	return Rx_clock;
}
